import {render} from '@testing-library/react';

import mapleLeaf from '../../../res/logo_maple.png';

const LeafsComponents = () => {
  render();

  return (
    <div>
      <img
        src={mapleLeaf}
        className="leafAnimation"
        style={{position: 'relative', marginTop: 190, marginLeft: 300}}
      />
      <img
        src={mapleLeaf}
        className="leaf2Animation"
        style={{position: 'relative', marginTop: 100}}
      />
    </div>
  );
};
export default LeafsComponents;
